// export default DataInput;

const DataInput = ({ onBackToDashboard }) => {
  // State variables for form fields
  const [productName, setProductName] = useState('');
  const [productCategory, setProductCategory] = useState('');
  const [additionalInformation, setAdditionalInformation] = useState('');
  const [productDescription, setProductDescription] = useState('');
  const [features, setFeatures] = useState('');
  const [options, setOptions] = useState('');

  // Function to handle form submission
  const handleSubmit = (event) => {
    event.preventDefault();
    // Logic to handle form submission
    // You can use the form field values here
    console.log('Form submitted');
  };

  return (
    <div>
      <h1>Data Input</h1>
      <form onSubmit={handleSubmit}>
        {/* Form fields */}
        <div>
          <label htmlFor="productName">Product Name:</label>
          <input
            type="text"
            id="productName"
            value={productName}
            onChange={(e) => setProductName(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="productCategory">Product Category:</label>
          <select
            id="productCategory"
            value={productCategory}
            onChange={(e) => setProductCategory(e.target.value)}
          >
            <select value={category} onChange={(e) => setCategory(e.target.value)}>
            <option value="category1">Seating</option>
            <option value="category2">Desk</option>
            <option value="category3">Collaborative Workspace</option>
            <option value="category4">Tables</option>
            <option value="category5">Office Storage</option>
            <option value="category6">Sofa/ Lounges</option>
            <option value="category7">Whiteboards/ Presentation Product</option>
            <option value="category8">Hospitality Furniture</option>
            <option value="category9">Acoustic Solutions</option>
            <option value="category10">Education</option>
            <option value="category10">Other</option>
          </select>
          </select>
        </div>
        <div>
          <label htmlFor="additionalInformation">Additional Information:</label>
          <input
            type="text"
            id="additionalInformation"
            value={additionalInformation}
            onChange={(e) => setAdditionalInformation(e.target.value)}
          />
        </div>
        <div>
          <label htmlFor="productDescription">Product Description:</label>
          <textarea
            id="productDescription"
            value={productDescription}
            onChange={(e) => setProductDescription(e.target.value)}
          ></textarea>
        </div>
        <div>
          <label htmlFor="features">Features:</label>
          <textarea
            id="features"
            value={features}
            onChange={(e) => setFeatures(e.target.value)}
          ></textarea>
        </div>
        <div>
          <label htmlFor="options">Options:</label>
          <textarea
            id="options"
            value={options}
            onChange={(e) => setOptions(e.target.value)}
          ></textarea>
        </div>
        {/* Back button */}
        <button onClick={onBackToDashboard}>Back to Dashboard</button>
        {/* Submit button */}
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

